= 'payPeriod'),`b`.`PARAM_VALUE`,NULL)) AS `payPeriod`,max(if((`b`.`PARAM_CODE` = 'payPeriodUnit'),`b`.`PARAM_VALUE`,NULL)) AS `payPeriodUnit`,max(if((`b`.`PARAM_CODE` = 'premium'),`b`.`PARAM_VALUE`,NULL)) AS `premium`,max(if((`b`.`PARAM_CODE` = 'projectCost'),`b`.`PARAM_VALUE`,NULL)) AS `projectCost`,max(if((`b`.`PARAM_CODE` = 'regularAddPremium'),`b`.`PARAM_VALUE`,NULL)) AS `regularAddPremium`,max(if((`b`.`PARAM_CODE` = 'renewalWay'),`b`.`PARAM_VALUE`,NULL)) AS `renewalWay`,max(if((`b`.`PARAM_CODE` = 'socialType'),`b`.`PARAM_VALUE`,NULL)) AS `socialType`,max(if((`b`.`PARAM_CODE` = 'survivalWay'),`b`.`PARAM_VALUE`,NULL)) AS `survivalWay`,max(if((`b`.`PARAM_CODE` = 'tFreeForeHead'),`b`.`PARAM_VALUE`,NULL)) AS `tFreeForeHead`,max(if((`b`.`PARAM_CODE` = 'beneficialType'),`b`.`PARAM_VALUE`,NULL)) AS `beneficialType`,max(if((`b`.`PARAM_CODE` = 'closedPeriods'),`b`.`PARAM_VALUE`,NULL)) AS `closedPeriods`,max(if((`b`.`PARAM_CODE` = 'closedPeriodUnit'),`b`.`PARAM_VALUE`,NULL)) AS `closedPeriodUnit`,max(if((`b`.`PARAM_CODE` = 'expectOpenDay'),`b`.`PARAM_VALUE`,NULL)) AS `expectOpenDay`,max(if((`b`.`PARAM_CODE` = 'reductionRadio'),`b`.`PARAM_VALUE`,NULL)) AS `reductionRadio`,max(if((`b`.`PARAM_CODE` = 'subscriptionFee'),`b`.`PARAM_VALUE`,NULL)) AS `subscriptionFee` from `t_trade_product_info` `b` where (`b`.`RC_STATE` = 'E') group by `b`.`TRADE_INFO_ID`,`b`.`PRODUCT_ID`) ;

-- ----------------------------
-- Procedure structure for PROC_CREATE_TRADE_PD_VIEW
-- ----------------------------
DROP PROCEDURE IF EXISTS `PROC_CREATE_TRADE_PD_VIEW`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` PROCEDURE `PROC_CREATE_TRADE_PD_VIEW`()
BEGIN
		/*需要执行的sql*/
		DECLARE V_SQL VARCHAR(4000);
		DECLARE V_CODE VARCHAR(20);
		DECLARE NO_MORE_CODE INTEGER DEFAULT 0;
		DECLARE V_CUR_PD_PARAM_TYPE CURSOR FOR SELECT A.CODE FROM T_DEF_CODE A WHERE CODE_TYPE IN ('wealthfactorCode', 'riskfactorCode');
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET NO_MORE_CODE=1;
		SET V_SQL = 'CREATE OR REPLACE VIEW T_TRADE_PRODUCT_INFO_VIEW AS(SELECT B.TRADE_INFO_ID TRADE_INFO_ID,B.PRODUCT_ID PRODUCT_ID,';

		/*循环游标生成动态sql语句*/
		OPEN V_CUR_PD_PARAM_TYPE;       /*打开之前定义的游标*/
			FETCH V_CUR_PD_PARAM_TYPE INTO V_CODE;   /*取出每条记录并赋值给相关变量，注意顺序*/
			WHILE NO_MORE_CODE != 1 DO
			 SET V_SQL = CONCAT(V_SQL,'MAX(IF(B.PARAM_CODE=''',V_CODE,''',PARAM_VALUE,NULL)) ',V_CODE,',');
			 FETCH V_CUR_PD_PARAM_TYPE INTO V_CODE;   /*取出每条记录并赋值给相关变量，注意顺序*/
			END WHILE;



			#REPEAT                      /*循环语句的关键词*/
			#	FETCH V_CUR_PD_PARAM_TYPE INTO V_CODE;   /*取出每条记录并赋值给相关变量，注意顺序*/
			#	SET V_SQL = CONCAT(V_SQL,'MAX(IF(B.PARAM_CODE=''',V_CODE,''',PARAM_VALUE,NULL)) ',V_CODE,',');
			#	UNTIL NO_MORE_CODE 
			#END REPEAT;    /*循环语句结束*/
		CLOSE V_CUR_PD_PARAM_TYPE;

		SET V_SQL = LEFT(V_SQL,LENGTH(V_SQL) - 1);
		SET V_SQL = CONCAT(V_SQL,' FROM T_TRADE_PRODUCT_INFO B WHERE B.RC_STATE = ','''E''','GROUP BY B.TRADE_INFO_ID,B.PRODUCT_ID)');

		SET @v_sql=V_SQL;   
    PREPARE stmt FROM @v_sql;
    EXECUTE stmt;   
		DEALLOCATE PREPARE stmt;

		#SET O_RESULT = V_SQL;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_CALL_APP_AGE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_CALL_APP_AGE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_CALL_APP_AGE`(I_TRADE_INFO_ID  VARCHAR(20)) RETURNS int(11)
BEGIN
	DECLARE O_APP_AGE INT DEFAULT 0;
	DECLARE V_VALID_DATE DATE;
  DECLARE V_BIRTHDAY   DATE;
    SET V_VALID_DATE = (SELECT A.STATUS_DATE
      FROM T_TRADE_STATUS_INFO A
     WHERE A.TRADE_INFO_ID = I_TRADE_INFO_ID
       AND A.TRADE_STATUS = '06'
       AND A.RC_STATE = 'E'
       GROUP BY A.TRADE_INFO_ID,A.STATUS_DATE);
    IF V_VALID_DATE IS NULL THEN
    SET  O_APP_AGE = NULL;
    END IF;
    SET V_BIRTHDAY = (SELECT C.BIRTHDAY
      FROM T_TRADE_CUST_INFO      A,
           T_TRADE_CUST_ROLE_INFO B,
           T_CUST_BASE_INFO       C
     WHERE A.TRADE_CUST_INFO_ID = B.TRADE_CUST_INFO_ID
       AND A.CUST_BASE_INFO_ID = C.CUST_BASE_INFO_ID
       AND B.ROLE_TYPE = '1' 
       AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
       AND A.RC_STATE = 'E'
       AND B.RC_STATE = 'E'
       AND C.RC_STATE = 'E');
    IF V_BIRTHDAY IS NULL THEN
    SET  O_APP_AGE = NULL;
    END IF;
    SET O_APP_AGE = FLOOR(DATEDIFF(V_VALID_DATE, V_BIRTHDAY) / 12);
    RETURN O_APP_AGE;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_CALL_CUST_AGE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_CALL_CUST_AGE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_CALL_CUST_AGE`(I_CALL_DATE  DATE,I_CUST_BIRTHDAY  DATE) RETURNS int(11)
BEGIN
	DECLARE O_CUST_AGE INT DEFAULT 0;
    DECLARE V_CALL_DATE DATE;
	SET V_CALL_DATE = I_CALL_DATE;
	IF I_CALL_DATE IS NULL 
	    THEN
			SET  V_CALL_DATE = (SELECT now());
    ELSEIF I_CUST_BIRTHDAY IS NULL 
	    THEN
          RETURN O_CUST_AGE;
       END IF;
     set  O_CUST_AGE = FLOOR(DATEDIFF(V_CALL_DATE, I_CUST_BIRTHDAY) /(30*12));
	 RETURN O_CUST_AGE ;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_CALL_POLICY_YEAR
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_CALL_POLICY_YEAR`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_CALL_POLICY_YEAR`(I_TRADE_INFO_ID  VARCHAR(20),
                                 I_PAY_TO_DATE VARCHAR(20)) RETURNS varchar(20) CHARSET utf8
BEGIN
    DECLARE O_POLICY_YEAR VARCHAR(20);
	DECLARE V_VALID_DATE  DATE;
    SET V_VALID_DATE = (SELECT A.STATUS_DATE
      FROM T_TRADE_STATUS_INFO A
     WHERE A.TRADE_INFO_ID = I_TRADE_INFO_ID
       AND A.TRADE_STATUS = '06'
       AND A.RC_STATE = 'E'
       GROUP BY A.TRADE_INFO_ID,A.STATUS_DATE);
    IF I_PAY_TO_DATE IS NULL OR
       I_PAY_TO_DATE = DATE_FORMAT(V_VALID_DATE, 'YYYY-MM-DD') 
	THEN
      SET O_POLICY_YEAR = 1;
    ELSE
      SET O_POLICY_YEAR = FLOOR(DATEDIFF(DATE_FORMAT(I_PAY_TO_DATE,
                                                    'YYYY-MM-DD'),
                                            V_VALID_DATE) / 12) + 1;
    END IF;
    RETURN O_POLICY_YEAR;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_FOUNDATE_CLOSED_ENDDATE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_FOUNDATE_CLOSED_ENDDATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_FOUNDATE_CLOSED_ENDDATE`(FOUNDATE DATE,CLOSEDPERIOR INTEGER,CLOSEDPERIORUNIT VARCHAR(10)) RETURNS varchar(10) CHARSET utf8
BEGIN

	DECLARE END_DATE VARCHAR (10) DEFAULT '';
	IF CLOSEDPERIORUNIT = 'M' THEN
	SET END_DATE = DATE_FORMAT(DATE_ADD(FOUNDATE,INTERVAL IFNULL(CLOSEDPERIOR,0) MONTH),'%Y-%m-%d');
	ELSEIF CLOSEDPERIORUNIT = 'Y' THEN
	SET END_DATE = DATE_FORMAT( DATE_ADD(FOUNDATE,INTERVAL IFNULL(CLOSEDPERIOR,0)  YEAR),'%Y-%m-%d');
	ELSE
	SET END_DATE = DATE_FORMAT(DATE_ADD(FOUNDATE , INTERVAL IFNULL(CLOSEDPERIOR,0) DAY),'%Y-%m-%d');
	END IF;
	RETURN END_DATE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_AFTER_DATE_NET_VALUE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_AFTER_DATE_NET_VALUE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_AFTER_DATE_NET_VALUE`(I_PD_WEALTH_ID  VARCHAR(20),
                                         I_AFTER_DATE VARCHAR(20)) RETURNS int(11)
BEGIN
	
	DECLARE O_NET_VALUE INT DEFAULT 0;
	DECLARE V_COUNT INT DEFAULT 0;
	DECLARE V_AFTER_DATE_MIN_PUBLIC_DATE INT DEFAULT 0;
    
	SET V_COUNT = (SELECT COUNT(1)
      
      FROM T_PD_WEALTH_NET_VALUE A
     WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
       AND A.PUBLIC_DATE >= DATE_FORMAT(I_AFTER_DATE, 'YYYY-MM-DD')
       AND A.RC_STATE = 'E');

    IF V_COUNT > 0 THEN
     
	 SET V_AFTER_DATE_MIN_PUBLIC_DATE =
	 (SELECT MIN(A.PUBLIC_DATE)
        FROM T_PD_WEALTH_NET_VALUE A
       WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
         AND A.PUBLIC_DATE >= DATE_FORMAT(I_AFTER_DATE, 'YYYY-MM-DD')
         AND A.RC_STATE = 'E');
     
	 SET O_NET_VALUE =  
	 (SELECT MAX(A.NET_VALUE)
        FROM T_PD_WEALTH_NET_VALUE A
        WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
         AND A.PUBLIC_DATE >= DATE_FORMAT(I_AFTER_DATE, 'YYYY-MM-DD')
         AND A.PUBLIC_DATE = V_AFTER_DATE_MIN_PUBLIC_DATE
         AND A.RC_STATE = 'E');
		 
      IF O_NET_VALUE IS NULL 
	  THEN
      SET  O_NET_VALUE = 0;
      END IF;
    END IF;
    RETURN O_NET_VALUE;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_ALL_REDEMPTION_COPIES
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_ALL_REDEMPTION_COPIES`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_ALL_REDEMPTION_COPIES`(I_PUBLIC_DAY varchar(20),I_TRADE_INFO_ID  varchar(20)) RETURNS decimal(20,4)
BEGIN
    DECLARE I_REDEMPTION_COPIES INT DEFAULT 0;
    SET I_REDEMPTION_COPIES = (select IFNULL(sum(b.actual_redemption_share), 0)
    from t_redemption_info       e,
           t_redemption_trade_info b,
           t_trade_status_info     c
     where e.rc_state = 'E'
       and b.rc_state = 'E'
       and e.redemption_info_id = b.redemption_info_id
       and e.redemption_status = '04'
       and e.redemption_openday <= I_PUBLIC_DAY
       and c.trade_info_id = b.trade_info_id
       and c.rc_state = 'E'
       and b.trade_info_id = I_TRADE_INFO_ID);

    IF I_REDEMPTION_COPIES IS NULL THEN
     SET I_REDEMPTION_COPIES = 0;
    END IF;

    RETURN I_REDEMPTION_COPIES;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_ALL_REDEMPTION_SHARE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_ALL_REDEMPTION_SHARE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_ALL_REDEMPTION_SHARE`(I_TRADE_INFO_ID  INT) RETURNS decimal(20,4)
BEGIN
     DECLARE O_ALL_REDEMPTION_SHARE decimal(20,4) DEFAULT 0;
     SET O_ALL_REDEMPTION_SHARE =  
	 (SELECT sum(A.ACTUAL_REDEMPTION_SHARE)
      FROM T_REDEMPTION_TRADE_INFO A,T_REDEMPTION_INFO  B
			
      WHERE 
					A.REDEMPTION_INFO_ID = B.REDEMPTION_INFO_ID
				AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
       AND B.REDEMPTION_STATUS='04'
       AND B.RC_STATE='E'
       AND A.RC_STATE = 'E');

    IF O_ALL_REDEMPTION_SHARE IS NULL THEN
     SET O_ALL_REDEMPTION_SHARE = 0;
    END IF;
    RETURN O_ALL_REDEMPTION_SHARE;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_BEFORE_DATE_BALA_DATE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_BEFORE_DATE_BALA_DATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_BEFORE_DATE_BALA_DATE`(I_PD_WEALTH_ID  VARCHAR(20),I_BEFORE_DATE   VARCHAR(20)) RETURNS varchar(20) CHARSET utf8
BEGIN
	DECLARE O_ACTU_BALA_DATE VARCHAR(10);
	DECLARE V_FOUND_DATE DATE;
    SET V_FOUND_DATE =
	(SELECT A.FOUND_DATE
      FROM T_PD_WEALTH A
     WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
       AND A.RC_STATE = 'E');
    IF V_FOUND_DATE > DATE_FORMAT(I_BEFORE_DATE, 'YYYY-MM-DD') THEN
    SET  O_ACTU_BALA_DATE = DATE_FORMAT(V_FOUND_DATE, 'YYYY-MM-DD');
    ELSE
     SET O_ACTU_BALA_DATE = I_BEFORE_DATE;
    END IF;
    RETURN O_ACTU_BALA_DATE;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_BEFORE_DATE_NET_VALUE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_BEFORE_DATE_NET_VALUE`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_BEFORE_DATE_NET_VALUE`(I_PD_WEALTH_ID  VARCHAR(20),
                                          I_BEFORE_DATE   VARCHAR(20)) RETURNS int(11)
BEGIN
   DECLARE O_NET_VALUE   decimal(20,6);                
   DECLARE V_BEFORE_DATE_MAX_PUBLIC_DATE DATE;
   DECLARE V_COUNT    INT     DEFAULT  0;
    -- 产品成立日净值为1
    SET O_NET_VALUE = 1;
    -- 查询此日期前是否存在净值维护记录
    SELECT COUNT(1)
      INTO V_COUNT
      FROM T_PD_WEALTH_NET_VALUE A
     WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
       AND A.PUBLIC_DATE <= STR_TO_DATE(I_BEFORE_DATE, 'YYYY-MM-DD')
       AND A.RC_STATE = 'E';

    IF V_COUNT > 0 THEN
      -- 如果存在净值记录，获取此日期前的最大公布日期
      SELECT MAX(A.PUBLIC_DATE)
        INTO V_BEFORE_DATE_MAX_PUBLIC_DATE
        FROM T_PD_WEALTH_NET_VALUE A
       WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
         AND A.PUBLIC_DATE <= STR_TO_DATE(I_BEFORE_DATE, 'YYYY-MM-DD')
         AND A.RC_STATE = 'E';
      -- 查询净值
      SELECT MAX(A.NET_VALUE)
        INTO O_NET_VALUE
        FROM T_PD_WEALTH_NET_VALUE A
       WHERE A.PD_WEALTH_ID = I_PD_WEALTH_ID
         AND A.PUBLIC_DATE <= STR_TO_DATE(I_BEFORE_DATE, 'YYYY-MM-DD')
         AND A.PUBLIC_DATE = V_BEFORE_DATE_MAX_PUBLIC_DATE
         AND A.RC_STATE = 'E';

      IF O_NET_VALUE IS NULL THEN
       SET O_NET_VALUE = 1;
      END IF;
    END IF;

    RETURN O_NET_VALUE;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_CHILD_LIST
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_CHILD_LIST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `FUNC_GET_CHILD_LIST`(rootId bigint) RETURNS varchar(4000) CHARSET utf8
begin
	declare sTemp varchar(4000);
    declare sTempChd varchar(4000);
    set sTemp = '';
    set sTempChd = cast(rootId as char);
    while sTempChd is not null do
		set sTemp = concat(sTemp, ',' , sTempChd);
        select group_concat(DISTINCT AGENT_ID) into sTempChd
        from t_agent_nurser_info
        where find_in_set(NURSER_AGENT_ID, sTempChd) > 0 and rc_state='E';
	end while;
    return SUBSTR(sTemp,2);
end
;;
DELIMITER ;

