-- ----------------------------
-- Function structure for FUNC_GET_END_DATE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_END_DATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `FUNC_GET_END_DATE`(FOUNDATE DATE,CLOSEDPERIOR VARCHAR(20),CLOSEDPERIORUNIT VARCHAR(10)) RETURNS varchar(50) CHARSET utf8
BEGIN
	DECLARE END_DATE VARCHAR (100) DEFAULT '';
	DECLARE endDateStr varchar(50) default '';
  DECLARE P_CLOSEDPERIOR VARCHAR(10) DEFAULT '';
  DECLARE P_END_DATE  VARCHAR(50) DEFAULT '';
	DECLARE I INT DEFAULT 1;
  DECLARE J INT DEFAULT 1;
		IF LOCATE('/',CLOSEDPERIOR) > 0
		THEN  
			SET CLOSEDPERIOR = CONCAT(CLOSEDPERIOR,'','/');
			loop_label:LOOP
      SET I = LOCATE('/',CLOSEDPERIOR,J);
			IF I > 0 
			THEN
        SET P_CLOSEDPERIOR= TRIM(SUBSTRING(CLOSEDPERIOR, J, I - J));
				SET P_END_DATE = FUNC_FOUNDATE_CLOSED_ENDDATE(FOUNDATE,P_CLOSEDPERIOR,CLOSEDPERIORUNIT);
        SET END_DATE = CONCAT(END_DATE,'/',P_END_DATE);
        SET  J = I + 1;
      END IF;
			IF I=0 THEN
				LEAVE loop_label;
			END IF;
     END LOOP;
		SET END_DATE = SUBSTRING(END_DATE, 2);
		ELSE
		SET END_DATE = FUNC_FOUNDATE_CLOSED_ENDDATE(FOUNDATE,CLOSEDPERIOR,CLOSEDPERIORUNIT);
		END IF;
	RETURN END_DATE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_FACTOR_NAME
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_FACTOR_NAME`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_FACTOR_NAME`(I_FACTOR_VALUE  VARCHAR(20),
                                I_FACTOR_CODE  VARCHAR(20)) RETURNS varchar(200) CHARSET utf8
BEGIN 
    DECLARE P_FACTOR_VALUE VARCHAR(100);
    DECLARE P_FACTOR_NAME  VARCHAR(100) DEFAULT '';
    DECLARE P_FACTOR_CODE  VARCHAR(100);
    DECLARE R_FACTOR_NAME  VARCHAR(200) DEFAULT '';
    DECLARE I     INT   DEFAULT 1;
    DECLARE J     INT   DEFAULT 1;
  
   
    IF (I_FACTOR_VALUE IS NULL OR I_FACTOR_CODE IS NULL) THEN
      RETURN '';
    END IF;
    IF (LENGTH(I_FACTOR_VALUE) > 0) THEN
       SET P_FACTOR_VALUE = TRIM(BOTH ',' FROM I_FACTOR_VALUE);
    ELSE
      RETURN '';
    END IF;
   loop_label:LOOP
      SET I = LOCATE(',',P_FACTOR_VALUE,J);
      IF I > 0 THEN
        SET P_FACTOR_CODE= TRIM(SUBSTRING(P_FACTOR_VALUE, J, I - J));
        SET P_FACTOR_NAME=(
							SELECT CONCAT(CODE,'-',CODE_NAME)
							FROM T_DEF_CODE
							WHERE CODE_TYPE = I_FACTOR_CODE
              AND CODE = P_FACTOR_CODE
				);
         
        SET R_FACTOR_NAME = CONCAT(R_FACTOR_NAME,',',P_FACTOR_NAME);
        SET  J = I + 1;
        ELSEIF I = 0 AND J  <= LENGTH(P_FACTOR_VALUE) THEN

        SET P_FACTOR_CODE = TRIM(SUBSTRING(P_FACTOR_VALUE,J,LENGTH(P_FACTOR_VALUE)));

          SET P_FACTOR_NAME=(
							SELECT CONCAT(CODE,'-',CODE_NAME)
							FROM T_DEF_CODE
              WHERE CODE_TYPE = I_FACTOR_CODE
             AND CODE = P_FACTOR_CODE
				);

        SET R_FACTOR_NAME = CONCAT(R_FACTOR_NAME,',',P_FACTOR_NAME);
        SET J = LENGTH(P_FACTOR_VALUE);
      END IF;
			IF I=0 THEN
				LEAVE loop_label;
			END IF;
     END LOOP;
    RETURN TRIM(BOTH ',' FROM R_FACTOR_NAME);
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_FA_ASS_FEE_FEE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_FA_ASS_FEE_FEE`;
DELIMITER ;;
CREATE DEFINER=`myadm`@`%` FUNCTION `FUNC_GET_FA_ASS_FEE_FEE`(I_AGENT_ID bigint(20),I_PAGE_DATE varchar(20)) RETURNS decimal(20,2)
BEGIN
	DECLARE O_AGENT_FEE DECIMAL(20,2) DEFAULT 0;
	DECLARE I_AGENT_POSITION_CODE VARCHAR(20);
	SET I_AGENT_POSITION_CODE =(
		SELECT A.POSITION_CODE	FROM t_agent_position A WHERE A.AGENT_ID = I_AGENT_ID
		);
	
	SET O_AGENT_FEE = (
		SELECT
			SUM(TEMP.sumTotalFee)
		FROM (
			SELECT
		    A.AGENT_ID			"agentId",
			IFNULL(A.TRADE_INFO_ID,NULL)  	"tradeInfoId",
	    	SUM(A.TRADE_TOTAL_ASSETS*E.EVALUATION_PERFORMANCE_INDEX/100)	"sumTotalFee",
			C.POSITION_CODE		"positionCode",
			C.GRADE_CODE		"gradeCode",
			E.STANDRAD_PERFORMANCE_INDEX	"standRadPerformanceIndex"
		  
			FROM T_TRADE_INFO A , t_agent B , t_agent_position_trace C ,t_trade_pd_info D,t_pd_product E
			WHERE A.RC_STATE = 'E'
			AND B.RC_STATE = 'E'
			AND C.RC_STATE = 'E'
			AND D.RC_STATE = 'E'
			AND E.RC_STATE = 'E'
			AND A.AGENT_ID = B.AGENT_ID
			AND B.AGENT_ID =  C.AGENT_ID
			AND A.TRADE_STAUS = '04'
			AND A.PLAY_MONEY_TIME IS NOT NULL
			AND QUARTER(A.PLAY_MONEY_TIME) = QUARTER(now())
			-- AND C.POSITION_CODE = 'FA'
			AND C.BLPOSITION_ID = (
					SELECT G.BLPOSITION_ID FROM t_agent_position_trace G WHERE G.RC_STATE = 'E' AND G.CREATE_DATE =(
						SELECT MAX(F.CREATE_DATE) FROM t_agent_position_trace F WHERE F.RC_STATE = 'E' AND F.AGENT_ID = A.AGENT_ID
					)				
			)
      AND A.TRADE_INFO_ID = D.TRADE_INFO_ID
			AND E.PRODUCT_ID = D.PRODUCT_ID
			AND DATE_FORMAT(A.PLAY_MONEY_TIME,'%Y-%m') = DATE_FORMAT(I_PAGE_DATE ,'%Y-%m')
			AND B.AGENT_ID = I_AGENT_ID
			
		UNION ALL
		SELECT 
			A.AGENT_ID			"agentId",
			IFNULL(A.TRADE_INFO_ID,NULL)  	"tradeInfoId",
	    	SUM(A.TRADE_TOTAL_ASSETS*E.EVALUATION_PERFORMANCE_INDEX/100)	"sumTotalFee",
			C.POSITION_CODE		"positionCode",
			C.GRADE_CODE		"gradeCode",
			E.STANDRAD_PERFORMANCE_INDEX	"standRadPerformanceIndex"
			FROM T_TRADE_INFO A , t_agent B ,t_agent_position_trace C,t_trade_pd_info D,t_pd_product E
			WHERE A.RC_STATE = 'E'
			AND B.RC_STATE = 'E'
			AND C.RC_STATE = 'E'
			AND D.RC_STATE = 'E'
			AND E.RC_STATE = 'E'
			AND A.AGENT_ID = B.AGENT_ID
			AND B.AGENT_ID =  C.AGENT_ID
			AND A.TRADE_STAUS = '04'
			AND A.PLAY_MONEY_TIME IS NOT NULL
			AND QUARTER(A.PLAY_MONEY_TIME) = QUARTER(now())
			-- AND C.POSITION_CODE = 'FA'
			AND C.BLPOSITION_ID = (
					SELECT G.BLPOSITION_ID FROM t_agent_position_trace G WHERE G.RC_STATE = 'E' AND G.CREATE_DATE =(
						SELECT MAX(F.CREATE_DATE) FROM t_agent_position_trace F WHERE F.RC_STATE = 'E' AND F.AGENT_ID = A.AGENT_ID
					)				
			)
			AND DATE_FORMAT(A.PLAY_MONEY_TIME,'%Y-%m') != DATE_FORMAT(A.TRADE_INPUT_DATE,'%Y-%m')
			AND A.PLAY_MONEY_TIME >= DATE_ADD(DATE_FORMAT(I_PAGE_DATE ,'%Y-%m-%D'),INTERVAL 1 DAY)
			AND A.PLAY_MONEY_TIME <= DATE_ADD(DATE_FORMAT(I_PAGE_DATE ,'%Y-%m-%D'),INTERVAL 7 DAY)
			AND A.TRADE_INFO_ID = D.TRADE_INFO_ID
			AND E.PRODUCT_ID = D.PRODUCT_ID
			AND B.AGENT_ID = I_AGENT_ID
		) TEMP
	)
	;
	IF ISNULL(O_AGENT_FEE) THEN
		SET O_AGENT_FEE = 0;
	END IF;
	RETURN O_AGENT_FEE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_MIN_FOUNDDATE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_MIN_FOUNDDATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `FUNC_GET_MIN_FOUNDDATE`(I_CUST_BASE_INFO_ID VARCHAR(20)) RETURNS varchar(10) CHARSET utf8
BEGIN
   DECLARE FOUND_DATE VARCHAR (10) DEFAULT '';
	 SET FOUND_DATE = (SELECT
												MIN(CASE
												WHEN d.PRODUCT_SUB_TYPE = "01" OR d.PRODUCT_SUB_TYPE = "02"
												THEN DATE_FORMAT(e.FOUND_DATE,'%Y-%m-%d')
												ELSE DATE_FORMAT(v.expectOpenDay,'%Y-%m-%d') 
												END)
												FROM
												t_cust_base_info a,
												t_trade_info b,
												t_trade_cust_info c,
												t_pd_product d,
												t_trade_product_info_view v,
												t_pd_wealth e
												WHERE 
												a.cust_base_info_id = c.cust_base_info_id
												AND b.trade_info_id = c.trade_info_id
												AND d.product_id = v.product_id
												AND b.trade_info_id = v.trade_info_id
												AND d.product_id = e.product_id
												AND a.cust_base_info_id = I_CUST_BASE_INFO_ID
												AND a.rc_state = 'E'
												AND b.rc_state = 'E'
												AND c.rc_state = 'E'
												AND d.rc_state = 'E'
												AND e.rc_state = 'E');
	 RETURN FOUND_DATE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_OPENDAY_RULES
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_OPENDAY_RULES`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `FUNC_GET_OPENDAY_RULES`(OPENDAYRULES varchar(200)) RETURNS varchar(100) CHARSET utf8
BEGIN
	DECLARE OPENDAY_RULES VARCHAR (100) DEFAULT '';
  DECLARE P_OPENDAYRULES VARCHAR(50) DEFAULT '';
  DECLARE P_OPENDAY_RULES  VARCHAR(50) DEFAULT '';
	DECLARE I INT DEFAULT 1;
  DECLARE J INT DEFAULT 1;
		IF LOCATE(',',SUBSTRING(OPENDAYRULES, 2)) > 0
		THEN  
			loop_label:LOOP
      SET I = LOCATE(',',CONCAT(SUBSTRING(OPENDAYRULES, 2),','),J);
			IF I > 0 
			THEN
        SET P_OPENDAYRULES= TRIM(SUBSTRING(SUBSTRING(OPENDAYRULES, 2), J, I-J));
				SET P_OPENDAY_RULES = FUNC_GET_CODE_NAME('productOpenDayRules',P_OPENDAYRULES);
        SET OPENDAY_RULES = CONCAT(OPENDAY_RULES,',',P_OPENDAY_RULES);
        SET  J = I + 1;
      END IF;
			IF I=0 THEN
				LEAVE loop_label;
			END IF;
     END LOOP;
		SET OPENDAY_RULES = SUBSTRING(OPENDAY_RULES, 2);
		ELSE
		SET OPENDAY_RULES = FUNC_GET_CODE_NAME('productOpenDayRules',SUBSTRING(OPENDAYRULES, 2));
		END IF;
	RETURN OPENDAY_RULES;
END
;;
DELIMITER ;

