-- ----------------------------
-- Function structure for FUNC_GET_QUARTER_BY_MONTH
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_QUARTER_BY_MONTH`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `FUNC_GET_QUARTER_BY_MONTH`(DATE VARCHAR(20)) RETURNS varchar(20) CHARSET utf8
BEGIN
	DECLARE QUARTERNAME VARCHAR(20);
SET QUARTERNAME = (CASE WHEN SUBSTR(DATE  FROM 6 FOR 2) IN (01,02,03)
									THEN CONCAT(SUBSTR(DATE  FROM 1 FOR 4),'','第1季度')
									WHEN SUBSTR(DATE  FROM 6 FOR 2) IN (04,05,06)
									THEN CONCAT(SUBSTR(DATE  FROM 1 FOR 4),'','第2季度')
									WHEN SUBSTR(DATE  FROM 6 FOR 2) IN (07,08,09)
									THEN CONCAT(SUBSTR(DATE  FROM 1 FOR 4),'','第3季度')
									WHEN SUBSTR(DATE  FROM 6 FOR 2) IN (10,11,12)
									THEN CONCAT(SUBSTR(DATE  FROM 1 FOR 4),'','第4季度')
									ELSE NULL
									END);
	RETURN QUARTERNAME;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GET_SCALE_FACTOR
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GET_SCALE_FACTOR`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `FUNC_GET_SCALE_FACTOR`(I_TRADE_INFO_ID  VARCHAR(100),
                                 I_ACTU_PREMIUM  VARCHAR(100)) RETURNS int(11)
BEGIN

    DECLARE O_SCALE_FACTOR     DECIMAL(10, 4); -- 返回的折标系数
    DECLARE V_TRADE_TYPE       VARCHAR(20); -- 交易类型
    DECLARE V_PAY_IN_TV        VARCHAR(4); -- 缴费频次
    DECLARE V_PAY_PERIOD_YEAR  INT(2)  DEFAULT  0; -- 缴费年期
    DECLARE V_PAY_PERIOD       VARCHAR(4); -- 缴费期间
    DECLARE V_PAY_PERIOD_UNIT  VARCHAR(4); -- 缴费期间单位
    DECLARE V_RISK_FEATURES    VARCHAR(2); -- 个人寿险类型（01-传统型，02-非传统型）
    DECLARE V_INS_PRO_SUB_TYPE VARCHAR(2); -- 保险类型（01-个人寿险，02-车险，03-银保）
    DECLARE V_BASIC_PREM       DECIMAL(10, 2)  DEFAULT  0; -- 个人寿险传统型产品基本保费
    DECLARE V_STAND_PREM       DECIMAL(10, 2)  DEFAULT  0; -- 标准保费
    DECLARE V_ACTU_PREM        DECIMAL(10, 2)  DEFAULT  0; -- 实收保费
 
    /*获取交易类型，产品类型等信息*/

    
     SET V_TRADE_TYPE=(
				SELECT MAX(A.TRADE_TYPE)
				FROM T_TRADE_INFO A
				WHERE A.TRADE_INFO_ID = I_TRADE_INFO_ID
				AND A.RC_STATE = 'E');

    
      SET V_PAY_IN_TV=(
				 SELECT A.payIntv  
				 FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
         WHERE A.PRODUCT_ID = B.PRODUCT_ID
         AND C.PRODUCT_ID = B.PRODUCT_ID
         AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
         AND B.PR_FLAG = 'M'
         AND B.RC_STATE = 'E'
         AND C.RC_STATE = 'E'
				);
      SET  V_PAY_PERIOD=( 
				 SELECT  A.payPeriod 
				 FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
         WHERE A.PRODUCT_ID = B.PRODUCT_ID
         AND C.PRODUCT_ID = B.PRODUCT_ID
         AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
         AND B.PR_FLAG = 'M'
         AND B.RC_STATE = 'E'
         AND C.RC_STATE = 'E'
				);

-- SELECT A.payIntv,
        --    A.payPeriod,
        -- A.payPeriodUnit,
        --   B.RISK_FEATURES,
        --   C.PRODUCT_SUB_TYPE,
        --   NVL(B.BASIC_PREM, 0)
   --   INTO V_PAY_IN_TV,
   --        V_PAY_PERIOD,
   --        V_PAY_PERIOD_UNIT,
   --        V_RISK_FEATURES,
   --        V_INS_PRO_SUB_TYPE,
   --        V_BASIC_PREM
   --   FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
   --  WHERE A.PRODUCT_ID = B.PRODUCT_ID
   --    AND C.PRODUCT_ID = B.PRODUCT_ID
   --    AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
   --    AND B.PR_FLAG = 'M'
   --    AND B.RC_STATE = 'E'
   --    AND C.RC_STATE = 'E';


       SET V_PAY_PERIOD_UNIT=(
				SELECT  A.payPeriodUnit 
				FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
         WHERE A.PRODUCT_ID = B.PRODUCT_ID
         AND C.PRODUCT_ID = B.PRODUCT_ID
         AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
         AND B.PR_FLAG = 'M'
         AND B.RC_STATE = 'E'
         AND C.RC_STATE = 'E'
				);
         SET  V_RISK_FEATURES=(
					 SELECT  B.RISK_FEATURES
				 	 FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
           WHERE A.PRODUCT_ID = B.PRODUCT_ID
           AND C.PRODUCT_ID = B.PRODUCT_ID
           AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
           AND B.PR_FLAG = 'M'
           AND B.RC_STATE = 'E'
           AND C.RC_STATE = 'E'
				 );
         SET V_INS_PRO_SUB_TYPE=(
						SELECT  C.PRODUCT_SUB_TYPE
						FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
						WHERE A.PRODUCT_ID = B.PRODUCT_ID
						AND C.PRODUCT_ID = B.PRODUCT_ID
						AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
						AND B.PR_FLAG = 'M'
						AND B.RC_STATE = 'E'
						AND C.RC_STATE = 'E'
				);
        SET V_BASIC_PREM =(
         SELECT  IFNULL(B.BASIC_PREM, 0)
         FROM T_TRADE_PRODUCT_INFO_VIEW A, T_PD_RISK B, T_PD_PRODUCT C
         WHERE A.PRODUCT_ID = B.PRODUCT_ID
         AND C.PRODUCT_ID = B.PRODUCT_ID
         AND A.TRADE_INFO_ID = I_TRADE_INFO_ID
         AND B.PR_FLAG = 'M'
         AND B.RC_STATE = 'E'
         AND C.RC_STATE = 'E'
				);

 
 
    /*财富产品没有*/
    IF V_TRADE_TYPE IS NULL OR V_TRADE_TYPE = '1' THEN
      SET O_SCALE_FACTOR = NULL;
    ELSE
      IF V_INS_PRO_SUB_TYPE = '01' THEN
        -- 个人寿险
        IF V_RISK_FEATURES = '01' THEN
          -- 传统险
          IF V_PAY_IN_TV = '0' THEN
            -- 趸交
            SET O_SCALE_FACTOR = 0.1;
          ELSE
            -- 计算缴费年期
           
						
             SET V_PAY_PERIOD_YEAR=(
									SELECT (CASE V_PAY_PERIOD_UNIT WHEN 'Y' THEN  V_PAY_PERIOD  
									WHEN 'M' THEN  V_PAY_PERIOD / 12 WHEN 'A' THEN V_PAY_PERIOD - FUNC_CALL_APP_AGE(I_TRADE_INFO_ID) END)
                    FROM DUAL);
            /*V_PAY_PERIOD_YEAR := ;*/
            IF V_PAY_PERIOD_YEAR < 10 THEN
              -- 10年期以下（不包含）
             SET O_SCALE_FACTOR = V_PAY_PERIOD_YEAR / 10;
            ELSE
              SET O_SCALE_FACTOR = 1;
            END IF;
          END IF;
        ELSEIF V_RISK_FEATURES = '02' THEN
          -- 非传统险
          -- 获取产品基本保费
          IF I_ACTU_PREMIUM <= V_BASIC_PREM THEN
            -- 基本保费以内为1
            SET O_SCALE_FACTOR = 1;
          ELSE
            -- 超过部分为0.1，算出标准保费/实收保费就是折标系数
           SET V_STAND_PREM  = V_BASIC_PREM * 1 +
                              (I_ACTU_PREMIUM - V_BASIC_PREM) * 0.1;
            SET O_SCALE_FACTOR = V_STAND_PREM / I_ACTU_PREMIUM;
          END IF;
        END IF;
      ELSE
        SET O_SCALE_FACTOR = NULL;
      END IF;
    END IF;
    RETURN O_SCALE_FACTOR;
  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_GRADE_CODE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_GRADE_CODE`;
DELIMITER ;;
CREATE DEFINER=`root`@`10.%.%.%` FUNCTION `FUNC_GRADE_CODE`(I_AGENT_ID BIGINT(20), I_CAL_SALARY_MONTH VARCHAR(20)) RETURNS varchar(20) CHARSET utf8
BEGIN
   DECLARE V_GRADE_CODE varchar(20);

	 DECLARE V_POSITION_CHANGE_FLAG varchar(20);
	 DECLARE V_POSITION_CHANGE_DATE date;
	 SET V_POSITION_CHANGE_FLAG = (SELECT A.POSITION_CHANGE_FLAG FROM t_agent_position A WHERE A.RC_STATE = 'E' AND A.AGENT_ID = I_AGENT_ID);
	 SET V_POSITION_CHANGE_DATE = (SELECT A.CREATE_DATE FROM t_agent_position A WHERE A.RC_STATE = 'E' AND A.AGENT_ID = I_AGENT_ID);

	
	 IF V_POSITION_CHANGE_FLAG = 'Y' THEN
			IF ((DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '01' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '12') or
					(DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '04' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '03') or
					(DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '07' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '06') or
					(DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '10' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '09')
         )
				THEN
	       SET V_GRADE_CODE = (SELECT G.GRADE_CODE FROM t_agent_position_trace G WHERE 
							G.RC_STATE = 'E' AND G.AGENT_ID = I_AGENT_ID AND G.CREATE_DATE =(
														SELECT MAX(F.CREATE_DATE) FROM 
														t_agent_position_trace F WHERE F.RC_STATE = 'E' AND F.AGENT_ID = I_AGENT_ID));
      ELSE
         SET V_GRADE_CODE = (SELECT A.GRADE_CODE FROM t_agent_position A 
								WHERE A.AGENT_ID = I_AGENT_ID AND A.RC_STATE = 'E');
      END IF;
	 ELSE
			SET V_GRADE_CODE = (SELECT A.GRADE_CODE FROM t_agent_position A 
								WHERE A.AGENT_ID = I_AGENT_ID AND A.RC_STATE = 'E');
	 END IF;
		

	 IF (V_GRADE_CODE is NULL or V_GRADE_CODE = '') THEN
			SET V_GRADE_CODE = (SELECT A.GRADE_CODE FROM t_agent_position A WHERE 
													A.AGENT_ID = I_AGENT_ID AND A.RC_STATE = 'E');
	 END IF;	
	 RETURN V_GRADE_CODE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for FUNC_POSITION_CODE
-- ----------------------------
DROP FUNCTION IF EXISTS `FUNC_POSITION_CODE`;
DELIMITER ;;
CREATE DEFINER=`root`@`10.%.%.%` FUNCTION `FUNC_POSITION_CODE`(I_AGENT_ID BIGINT(20) , I_CAL_SALARY_MONTH VARCHAR(20)) RETURNS varchar(20) CHARSET utf8
BEGIN
   DECLARE V_POSITION_CODE varchar(20);
	 DECLARE V_POSITION_CHANGE_FLAG varchar(20);
   DECLARE V_POSITION_CHANGE_DATE date;
	
	 	
	 SET V_POSITION_CHANGE_FLAG = (SELECT A.POSITION_CHANGE_FLAG FROM t_agent_position A WHERE A.RC_STATE = 'E' AND A.AGENT_ID = I_AGENT_ID);
	 SET V_POSITION_CHANGE_DATE = (SELECT A.CREATE_DATE FROM t_agent_position A WHERE A.RC_STATE = 'E' AND A.AGENT_ID = I_AGENT_ID);
	 IF V_POSITION_CHANGE_FLAG = 'Y' THEN
			IF ((DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '01' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '12') or
					(DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '04' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '03') or
					(DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '07' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '06') or
					(DATE_FORMAT(V_POSITION_CHANGE_DATE,'%m') = '10' and DATE_FORMAT(I_CAL_SALARY_MONTH ,'%m') = '09')
         )
				THEN
	       SET V_POSITION_CODE = (SELECT G.POSITION_CODE FROM t_agent_position_trace G WHERE 
							G.RC_STATE = 'E' AND G.AGENT_ID = I_AGENT_ID AND G.CREATE_DATE =(
														SELECT MAX(F.CREATE_DATE) FROM 
														t_agent_position_trace F WHERE F.RC_STATE = 'E' AND F.AGENT_ID = I_AGENT_ID));
      ELSE
         SET V_POSITION_CODE = (SELECT A.POSITION_CODE FROM t_agent_position A 
								WHERE A.AGENT_ID = I_AGENT_ID AND A.RC_STATE = 'E');
      END IF;
	 ELSE
			SET V_POSITION_CODE = (SELECT A.POSITION_CODE FROM t_agent_position A 
								WHERE A.AGENT_ID = I_AGENT_ID AND A.RC_STATE = 'E');
	 END IF;
	 
	 IF (V_POSITION_CODE is NULL or V_POSITION_CODE = '') THEN
			SET V_POSITION_CODE = (SELECT A.POSITION_CODE FROM t_agent_position A 
			WHERE A.AGENT_ID = I_AGENT_ID AND A.RC_STATE = 'E');
	 END IF;	
	 RETURN V_POSITION_CODE;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getChildLst
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildLst`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `getChildLst`(rootId int) RETURNS varchar(4000) CHARSET utf8
begin
	declare sTemp varchar(4000);
    declare sTempChd varchar(4000);
    set sTemp = '$';
    set sTempChd = cast(rootId as char);
    while sTempChd is not null do
		set sTemp = concat(sTemp, ',' , sTempChd);
        select group_concat(DISTINCT AGENT_ID) into sTempChd
        from t_agent_nurser_info T
        where find_in_set(T.NURSER_AGENT_ID, sTempChd) > 0
          AND T.RC_STATE = 'E';
	end while;
    return sTemp;
end
;;
DELIMITER ;

-- ----------------------------
-- Function structure for queryChildrenNodeInfo
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenNodeInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%.%.%.%` FUNCTION `queryChildrenNodeInfo`(areaId INT) RETURNS varchar(4000) CHARSET utf8
BEGIN

DECLARE sTemp VARCHAR(4000);

DECLARE sTempChd VARCHAR(4000);

SET sTemp = '$';

SET sTempChd = cast(areaId as char);
WHILE sTempChd is not NULL DO

SET sTemp = CONCAT(sTemp,',',sTempChd);

SELECT group_concat(COM_ID) INTO sTempChd FROM t_def_com where FIND_IN_SET(PARENT_COM_ID,sTempChd)>0 and rc_state='E';

END WHILE;

return sTemp;

END
;;
DELIMITER ;
